import React from 'react';
import './tech.css';
import Nav from './Nav';
import tech from '../images/tech.png';
import Robot from '../images/robot.png';
import It from '../images/it.png';
import Ai from '../images/ai.png';
import Es from '../images/es.png';
import Cs from '../images/cs.png';


function Tech() {
  return (
    <div className='tech' >
      <Nav/>
      <div className='sec-3'>
          <div class="topic-1">Technology</div>
          <div className='link-1'> Sign up..</div>
          <img className='tech-1' src={tech} alt='tech-sticker' style={{float:'left'}}/>

        </div><br/>
        <div className='sec-2'> 
          <div className='box-1'>
            <img className='menu-img-t' src={It} alt='it'/>
          </div>
          <div className='box-1'>
            <img className='menu-img-t' src={It} alt='it'/>
          </div>
          <div className='box-1'>
            
          </div>
          <div className='box-1'></div>
          <div className='box-2'>
          <img className='img-robot' src={Robot} alt='robot'/>
          </div>
        </div><br/>
        
    </div>
  );
}

export default Tech;
